import React from "react";

class Footer extends React.Component {
  render() {
    return (
      <footer className="footer bg-light mt-5">
        <div className="footer-copyright text-center py-3">
          &copy; 2018 Copyright: Raju Choudhary
        </div>
      </footer>
    );
  }
}

export default Footer;
